      style={{ backgroundColor: type === "men" ? "blue" : "pink" }}
    >
      <div>Name : {name}</div>
      <div>Age : {age}</div>
      <div>Phone : {phone}</div>
      <div>Address : {address}</div>

      <div
        className={styles.deleteBtn}
        onClick={(event) => deleteHandel(event, id)}
      >
        x
      </div>
    </div>
  );
};

